import React, {Fragment, useState, useEffect} from 'react';
import axios from 'axios';


function App() {
  const [data, setData] = useState([]);

  const rien = "lol";

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'https://jsonplaceholder.typicode.com/posts',
      );

      setData(result.data);
      console.log("updated");
    };
    fetchData();
    console.log("mounted");

  }, [])


  return (
    <Fragment>  
      <ul>
        {data.map((item, key, rien) =>(
          <li className={rien} key={key}>
            <p>{item.title}</p>
          </li>
        ))}
      </ul>
    </Fragment>
  )

}

export default App;
